const icons = [perfil, bag];

function iconsHeader() {
  return (
    <ul className="icon">
      {icons.map((icon) => (
        <li className="icon-li">
          <img src={icon} alt="icon" />
        </li>
      ))}
    </ul>
  );
}
export default iconsHeader;
